class Solution {
public:
    bool lineValid(set<long long>& pts, long long cpt, int xa, int ya, int n)
    {
        if (pts.size())
        {
            int xxx = 0;
        }
        int* acpt = (int*)&cpt;
        while (true)
        {
            acpt[0] += xa;
            acpt[1] += ya;
            int ss1 = acpt[0];
            int ss2 = acpt[1];
            if (acpt[0] >= n || acpt[1] >= n || acpt[0] < 0 || acpt[1] < 0)
            {
                break;
            }

            if (pts.find(cpt) != pts.end())
            {
                return false;
            }
        }

        return true;
    }

    bool valid(int x, int y, set<long long>& pts, int n)
    {
        long long cpt;
        int* acpt = (int*)&cpt;
        acpt[0] = x;
        acpt[1] = y;

        if (!lineValid(pts, cpt, 1, 1, n)) return false;
        if (!lineValid(pts, cpt, 1, -1, n)) return false;
        if (!lineValid(pts, cpt, -1, -1, n)) return false;
        if (!lineValid(pts, cpt, -1, 1, n)) return false;
        if (!lineValid(pts, cpt, 1, 0, n)) return false;
        if (!lineValid(pts, cpt, -1, 0, n)) return false;
        if (!lineValid(pts, cpt, 0, 1, n)) return false;
        if (!lineValid(pts, cpt, 0, -1, n)) return false;

        return true;
    }

    void block(set<long long> pts, int s, int cx, int cy, vector<set<long long>>& res)
    {
        if (cx == 2 && cy == 1)
        {
            int xxx = 0;
        }

        bool bvalid = false;
        if (valid(cx, cy, pts, s))
        {
            bvalid = true;

            long long cpt;
            int* acpt = (int*)&cpt;
            acpt[0] = cx;
            acpt[1] = cy;

            if (cx < s - 1)
            {
                block(pts, s, cx + 1, cy, res);
            }

            pts.insert(cpt);

            if (cy == s - 1)
            {
                res.push_back(pts);
                return;
            }

        }

        if (!bvalid)
        {
            if (cx == s - 1)
            {
                return;
            }

            block(pts, s, cx + 1, cy, res);
            return;
        }

        if (cy == s - 1)
        {
            return;
        }

        cx = 0;
        cy += 1;

        block(pts, s, cx, cy, res);
    }
    vector<vector<string>> solveNQueens(int n) {
        vector<vector<string>> res;
        set<long long> pts;
        vector<set<long long>> tres;

        block(pts, n, 0, 0, tres);

        qDebug() << tres.size();

        int p[n][n];
        for (auto vec : tres)
        {
            memset(p, 0, sizeof(p));

            for (auto& cpt : vec)
            {
                int* acpt = (int*)&cpt;
                p[acpt[0]][acpt[1]] = 1;
            }

            vector<string> sss;
            for (int i = 0; i < n; ++i)
            {
                string s;
                for (int j = 0; j < n; ++j)
                {
                    s += p[i][j] ? 'Q' : '.';
                }

                sss.push_back(s);
            }
            res.push_back(sss);
        }

        return res;
    }
};

